function HomePage(state, action) {
  switch (action.type) {
    case "SCROLLED":
      return { scrolled: true, ...state };
    case "NOT_SCROLLED":
      return { scrolled: false, ...state };
    case "SHOW_LOGIN":
      return { login: true, ...state };
    case "HIDE_LOGIN":
      return { login: false, ...state };
    default:
      return state;
  }
}

const reducer = {
  HomePage,
};

export default reducer;
